import styled from "styled-components";
import React from 'react';

export default function Skills({language}) {

  return (
    <Container >
        {!language ? <>
                <h1>Educação</h1>
            </> :
            <>
                <h1>Education</h1>
            </>}
    </Container>
  );
}


const Container = styled.div`
    height: 85vh;
    padding-left: 5%;
    padding-right: 5%;
    display: flex;
    flex-direction: column;
    background-color: #080808;


    h1{
